// NewShopPage.js
import React from 'react';
import NewShopForm from '../components/NewShopForm';

const NewShopPage = () => {
  return (
    <div>
      <h2>New Shop Form</h2>
      <NewShopForm />
    </div>
  );
};

export default NewShopPage;
